                        1、本报告检测项目中A、B、C等级的设定，是根据该项目对消防系统运行所起作用的程度不同而定:



















                        A等级：是指对消防工程有重要影响的项目;



















                        B等级：是指对消防工程有较大影响的项目;



















                        C等级：是指对消防工程有一定影响的项目。































